import { Component, OnInit } from '@angular/core';
import { DomSanitizer } from '@angular/platform-browser';

@Component({
  selector: 'app-card-a02',
  templateUrl: './card-a02.component.html',
  styleUrls: ['./card-a02.component.css']
})
export class CardA02Component implements OnInit {

  title: string = 'Despotismo';
  cardImage;

  constructor(private sanitizer: DomSanitizer) { }

  ngOnInit() {
    this.cardImage = this.sanitizer.bypassSecurityTrustResourceUrl(`data:image/png;base64, ${cardBase64}`);
  }

}

export const cardBase64 = "";